import React from 'react';
import './Timetable.css';

const Timetable = ({ onRouteChange }) => {
	return(
		<div>
			<div>
				<p className='f2 h1'>Days</p>
				<p className='f2'>9-10 am</p>
				<p className='f2'>10-11 am</p>
				<p className='f2'>11-12 am</p>
				<p className='f2'>12-1 pm</p>
				<p className='f2'>1-2 pm</p>
				<p className='f2'>2-3 pm</p>
				<p className='f2'>3-4 pm</p>
				<p className='f2'>4-5 pm</p>
				<p className='f2'>5-6 pm</p>
			</div>
		</div>
	);
}

export default Timetable;
